import React from 'react';

const Home = () => {
  return (
    <div className="container mt-4">
      <h1>Welcome to our React SPA!</h1>
      <p className="lead">
        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vestibulum sagittis orci vel lacus efficitur, ac volutpat odio laoreet.
        Nullam nec nisl vitae nisi rhoncus pulvinar sed vel sem. Donec vel ligula sit amet ligula vestibulum consectetur.
      </p>
      <p>
        Mauris ultricies metus a libero lacinia, vel luctus justo dictum. Suspendisse potenti. Integer luctus pharetra urna, a pretium purus tempor in.
        Nulla scelerisque risus id nulla porttitor, a iaculis dui varius. Proin pellentesque lobortis nisl.
      </p>
    </div>
  );
};

export default Home;
